import styled from 'styled-components';

export const NewItemCard = ({ item }) => {
  return (
    <div>
      <h3>{item.name}</h3>
      <p>{item.price}</p>
    </div>
  );
};

const ItemCard = styled.div`
  border: 4px solid #a9a9a9;
`;
